class Solution {
    public int maxOperations(String s) {
        int pre=0,count=0,x=0;
        for(int i=s.length()-1;i>=0;i--){
            if(s.charAt(i)=='1'){
               if(x==1){pre++;}
               count +=pre;
               x=0;
            }else{
                x=1;
            }
        }
        return count;
    }
}
